
--资源详情表
--drop table admin_org_worktime;
CREATE TABLE admin_org_worktime    (
	org_id varchar(255) NOT NULL COMMENT '资源名称', 
    am_hour int(2) NOT NULL  COMMENT '上班小时',
    am_minute int(2) NOT NULL  COMMENT '上班分钟',
    pm_hour int(2) NOT NULL  COMMENT '下班小时',
    pm_minute int(2) NOT NULL  COMMENT '下班分钟',
	STATUS CHAR(1) DEFAULT 'Y' NOT NULL  COMMENT '可用状态', 

	FOREIGN KEY (org_id) REFERENCES admin_organization(ID)
)ENGINE=InnoDB AUTO_INCREMENT=1000 DEFAULT CHARSET=utf8;



 		select u.id u_id, u.realname name, u.telephone mobile,
        substring_index(o.name,'-',1) department,  
        
        CASE WHEN  o.name like '%-%' THEN substring_index(o.name, '-', -1)
		ELSE '' END project,
        
        CASE WHEN  o1.name like '%区域公司%' THEN '区域公司'
        WHEN  o1.name like '%一公司%' THEN '一公司'
        WHEN  o1.name like '%二公司%' THEN '二公司'
        WHEN  o1.name like '%三公司%' THEN '三公司'
        WHEN  o1.name like '%四公司%' THEN '四公司'
        WHEN  o1.name like '%江苏事业部%' THEN '江苏事业部'
		ELSE o1.name END company,
		ao.am_time,ao.pm_time,ao.sequence
		
		from admin_user u 
		left join admin_organization o on o.id=u.organization_id 
		left join admin_organization o1 on o1.id=o.parent
		left join admin_user_otherinfo ao on u.telephone = ao.mobile
		where o1.name is not null 
        and o1.name like '%绿地集团%'
        and u.telephone not in (
        '17755572287','13952078610','17366001910',
        '17312276662','13851781324','17366010645',
        '13813959088','18994018881'
        )
        
        
        

--drop table admin_user_otherinfo;
CREATE TABLE admin_user_otherinfo    (
	u_id varchar(255) default NULL COMMENT 'admin_user_id', 
	name varchar(20) NOT NULL COMMENT 'name', 
	mobile varchar(15) NOT NULL UNIQUE COMMENT 'mobile', 
	am_time varchar(15) NOT NULL default '08:30' COMMENT 'am worktime', 
	pm_time varchar(15) NOT NULL default '17:30' COMMENT 'pm worktime', 
    sequence int(10) NOT NULL  default 1000000 COMMENT 'sort no',
    companySeq  int(10) NOT NULL  default 1000000 COMMENT 'company sort no',
	company varchar(15) default NULL COMMENT 'company', 
	department varchar(15) default NULL COMMENT 'department', 
	project varchar(15) default NULL COMMENT 'project'
)ENGINE=InnoDB  DEFAULT CHARSET=utf8;








